import { useNavigate } from "react-router-dom";

function CreatePost() {
  const navigate = useNavigate();
  return (
    <div style={{ width: "90%", margin: "auto auto", textAlign: "center" }}>
      <h1>Create a post</h1>
      <Button style={{ width: "100%" }} onClick={() => navigate(-1)}>
        BACK
      </Button>
    </div>
  );
}

export default CreatePost;
